import React, { Component } from 'react';
import '../css/posteditor.css';
class PostEditor extends Component {
  constructor(props) {
    super(props);
    this.state = {};
  }

  render() {
    return (
      <div className='posteditor_contain'>
        <input type="text"/>
        <textarea name="" id="" cols="30" rows="10"></textarea>
        <button>保存</button>
        <button>取消</button>
      </div>
    )
  }
}

export default PostEditor;
